import {
  Nav,
  Navbar,
  Form,
  FormControl,
  Container,
  NavDropdown,
  Button,
} from "react-bootstrap";
import { useState, useContext } from "react";
import { ModeContext } from "./ModeContext";
import { Arabic } from "./Language";
import { English } from "./Language";
function Header() {
  const value = useContext(ModeContext);
  const [show, setShow, language, setLanguage] = useContext(ModeContext);
  //const [language, setLanguage]= useContext(LanguageContext);
  function ChangeLnaguage(x) {
    setLanguage(x);
  }
  function handleShow() {
    setShow(true);
  }

  return (
    <div className="header">
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Container>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#services">{language.header.service}</Nav.Link>
              <Nav.Link href="#about">{language.header.about}</Nav.Link>
              <Nav.Link href="#contact">{language.header.contact}</Nav.Link>
              <NavDropdown title={language.header.language} id="nav-dropdown">
                <NavDropdown.Item
                  onClick={() => ChangeLnaguage(Arabic)}
                  eventKey="4.1"
                >
                  عربي
                </NavDropdown.Item>
                <NavDropdown.Item
                  onClick={() => ChangeLnaguage(English)}
                  eventKey="4.2"
                >
                  English
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
            <Nav>
              <Nav.Link href="#">
                <Button onClick={handleShow}>{language.header.order}</Button>
              </Nav.Link>
              <Nav.Link href="tel:+971563201418">
                <Button>{language.header.call}</Button>
              </Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Header;
